import React, { Component } from 'react';
import './Contact.css';
import { Navbar } from 'react-bootstrap';

class Contact extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Navbar.Collapse className='justify-content-end'>
                <button type="button" className='nav-link active text-secondary text-center text-hover-color customButton' onClick={this.props.callback} >CONTACT</button>
            </Navbar.Collapse>
        );
    }
}

export default Contact;
